DROP TABLE IF EXISTS `cli_cliente`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `cli_cliente` (
  `id_cliente` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Identificador de cliente en la empresa',
  `cuenta` varchar(11) NOT NULL,
  `fecha` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Fecha de ingreso del registro',
  `descripcion` varchar(100) NOT NULL COMMENT 'Nombre de la empresa o persona que es cliente de la empresa.',
  `direccion` varchar(100) NOT NULL COMMENT 'Ubicación física del cliente',
  `id_ciudad` int(11) unsigned NOT NULL COMMENT 'Identificador  de la ciudad de residencia del cliente.',
  `telefono` varchar(25) DEFAULT NULL COMMENT 'Teléfono de contacto con el cliente.',
  `nit` varchar(11) DEFAULT NULL COMMENT 'NIT del cliente',
  `correo` varchar(75) DEFAULT NULL COMMENT 'Correo de contacto con el cliente',
  `id_ruta_entrega` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'Ruta de Entrega de Producto',
  `credito` enum('S','N') NOT NULL DEFAULT 'N' COMMENT 'Estado si el cliente tiene credito o no.',
  `dias_credito` int(11) NOT NULL DEFAULT '0' COMMENT 'El número de días de credito que se le ha otorgado al cliente.',
  `monto_credito` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT 'Monto Total de credito otorgado al cliente',
  `id_vendedor` int(11) unsigned NOT NULL COMMENT 'Es la persona que atiende al cliente.',
  `id_operador` int(11) unsigned NOT NULL COMMENT 'Es la persona que ingreso el registro',
  `estado_registro` enum('A','B') NOT NULL DEFAULT 'A' COMMENT 'El estado del registro, A-Alta y B-Baja',
  `categoria_cliente` enum('N','P') DEFAULT 'N',
  `cli_clientecol` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id_cliente`),
  KEY `idx_cli_id_ruta_entrega` (`id_ruta_entrega`),
  KEY `idx_cli_cuenta` (`cuenta`),
  KEY `id_ciudad_idx` (`id_ciudad`),
  CONSTRAINT `id_ciudad` FOREIGN KEY (`id_ciudad`) REFERENCES `sys_ciudad` (`id_ciudad`),
  CONSTRAINT `id_ruta_entrega` FOREIGN KEY (`id_ruta_entrega`) REFERENCES `opr_ruta_entrega` (`id_ruta_entrega`)
) ENGINE=InnoDB AUTO_INCREMENT=5001 DEFAULT CHARSET=utf8 COMMENT='Tabla contiene la información de los clientes de la empresa.';
